import { useContext } from "react";
import { AuthContext } from "../context/AuthContext";
import { useNavigate, Link } from "react-router-dom";

const Dashboard = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/");
  };

  if (!user) {
    return (
      <div style={styles.container}>
        <div style={styles.notLoggedIn}>
          <p>You are not logged in.</p>
          <Link to="/login" style={styles.link}>
            Go to Login
          </Link>
        </div>
      </div>
    );
  }

  const styles = {
    container: {
      minHeight: "100vh",
      background: "linear-gradient(135deg, #667eea 0%, #764ba2 100%)",
      padding: "20px",
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    },
    header: {
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      padding: "30px 40px",
      maxWidth: "1200px",
      margin: "0 auto",
      color: "white",
    },
    logo: {
      fontSize: "28px",
      fontWeight: "700",
    },
    userInfo: {
      display: "flex",
      alignItems: "center",
      gap: "20px",
    },
    userName: {
      fontSize: "16px",
      fontWeight: "600",
    },
    button: {
      padding: "10px 20px",
      backgroundColor: "white",
      color: "#667eea",
      border: "none",
      borderRadius: "8px",
      fontWeight: "600",
      cursor: "pointer",
      transition: "all 0.3s ease",
    },
    buttonHover: {
      transform: "translateY(-2px)",
      boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
    },
    mainContent: {
      maxWidth: "1200px",
      margin: "40px auto",
    },
    greeting: {
      fontSize: "42px",
      fontWeight: "800",
      color: "white",
      marginBottom: "30px",
      textShadow: "2px 2px 4px rgba(0,0,0,0.2)",
    },
    cardGrid: {
      display: "grid",
      gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
      gap: "25px",
    },
    card: {
      background: "white",
      borderRadius: "12px",
      padding: "30px",
      boxShadow: "0 10px 30px rgba(0,0,0,0.1)",
      transition: "all 0.3s ease",
      cursor: "pointer",
    },
    cardHover: {
      transform: "translateY(-5px)",
      boxShadow: "0 15px 40px rgba(0,0,0,0.15)",
    },
    cardIcon: {
      fontSize: "40px",
      marginBottom: "15px",
    },
    cardTitle: {
      fontSize: "20px",
      fontWeight: "700",
      color: "#333",
      marginBottom: "10px",
    },
    cardDesc: {
      color: "#666",
      fontSize: "14px",
      lineHeight: "1.6",
    },
    cardLink: {
      display: "inline-block",
      marginTop: "15px",
      color: "#667eea",
      fontWeight: "600",
      textDecoration: "none",
      transition: "all 0.3s ease",
    },
  };

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <div style={styles.logo}>EventHub</div>
        <div style={styles.userInfo}>
          <span style={styles.userName}>Welcome, {user.name || "User"}!</span>
          <button
            onClick={handleLogout}
            style={styles.button}
            onMouseOver={(e) => Object.assign(e.target.style, styles.buttonHover)}
            onMouseOut={(e) => {
              e.target.style.transform = "translateY(0)";
              e.target.style.boxShadow = "none";
            }}
          >
            Logout
          </button>
        </div>
      </header>

      <main style={styles.mainContent}>
        <h1 style={styles.greeting}>Your Dashboard</h1>

        <div style={styles.cardGrid}>
          <Link to="/dashboard" style={{ textDecoration: "none" }}>
            <div
              style={styles.card}
              onMouseOver={(e) => Object.assign(e.currentTarget.style, styles.cardHover)}
              onMouseOut={(e) => {
                e.currentTarget.style.transform = "translateY(0)";
                e.currentTarget.style.boxShadow = "0 10px 30px rgba(0,0,0,0.1)";
              }}
            >
              <div style={styles.cardIcon}>üéâ</div>
              <div style={styles.cardTitle}>Events</div>
              <div style={styles.cardDesc}>Create and manage your events</div>
              <Link to="/dashboard" style={styles.cardLink}>
                Manage Events ‚Üí
              </Link>
            </div>
          </Link>

          <Link to="/dashboard" style={{ textDecoration: "none" }}>
            <div
              style={styles.card}
              onMouseOver={(e) => Object.assign(e.currentTarget.style, styles.cardHover)}
              onMouseOut={(e) => {
                e.currentTarget.style.transform = "translateY(0)";
                e.currentTarget.style.boxShadow = "0 10px 30px rgba(0,0,0,0.1)";
              }}
            >
              <div style={styles.cardIcon}>üë•</div>
              <div style={styles.cardTitle}>Guests</div>
              <div style={styles.cardDesc}>Manage guest lists and invitations</div>
              <Link to="/dashboard" style={styles.cardLink}>
                View Guests ‚Üí
              </Link>
            </div>
          </Link>

          <Link to="/dashboard" style={{ textDecoration: "none" }}>
            <div
              style={styles.card}
              onMouseOver={(e) => Object.assign(e.currentTarget.style, styles.cardHover)}
              onMouseOut={(e) => {
                e.currentTarget.style.transform = "translateY(0)";
                e.currentTarget.style.boxShadow = "0 10px 30px rgba(0,0,0,0.1)";
              }}
            >
              <div style={styles.cardIcon}>‚úì</div>
              <div style={styles.cardTitle}>Tasks</div>
              <div style={styles.cardDesc}>Track and organize your to-dos</div>
              <Link to="/dashboard" style={styles.cardLink}>
                View Tasks ‚Üí
              </Link>
            </div>
          </Link>

          <Link to="/dashboard" style={{ textDecoration: "none" }}>
            <div
              style={styles.card}
              onMouseOver={(e) => Object.assign(e.currentTarget.style, styles.cardHover)}
              onMouseOut={(e) => {
                e.currentTarget.style.transform = "translateY(0)";
                e.currentTarget.style.boxShadow = "0 10px 30px rgba(0,0,0,0.1)";
              }}
            >
              <div style={styles.cardIcon}>üí∞</div>
              <div style={styles.cardTitle}>Expenses</div>
              <div style={styles.cardDesc}>Monitor and manage event costs</div>
              <Link to="/dashboard" style={styles.cardLink}>
                View Expenses ‚Üí
              </Link>
            </div>
          </Link>

          <Link to="/dashboard" style={{ textDecoration: "none" }}>
            <div
              style={styles.card}
              onMouseOver={(e) => Object.assign(e.currentTarget.style, styles.cardHover)}
              onMouseOut={(e) => {
                e.currentTarget.style.transform = "translateY(0)";
                e.currentTarget.style.boxShadow = "0 10px 30px rgba(0,0,0,0.1)";
              }}
            >
